import React from "react";

class mainApp extends React.Component {
  render() {
    return (
      <main>
        <form>
          <label className="form-label" for="name">
            Name
          </label>
          <input type="text" id="name" className="form-control" />
        </form>
        <p>Hola Mundo</p>
      </main>
    );
  }
}

export default mainApp;
